    "contracts/Subscription.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "hardhat/console.sol";

contract Subscription is
    Initializable,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable
{
    using Counters for Counters.Counter;
    using Address for address;

    Counters.Counter private _planIds;

    struct Plan {
        uint id;
        address merchant;
        uint amount; //? SERSH Amount
        uint decimals;
        uint frequency;
        uint personalBoxes;
        uint heirBoxes;
        uint heirs;
        string label;
        string description;
        uint personalBoxSlots;
        uint heirStrongBoxSlots;
    }

    struct Agreement {
        Plan plan;
        address currency;
        address subscriber;
        uint createdAt;
        uint expiredAt;
    }

    mapping(uint => Plan) public _plans;
    // mapping(address => Agreement) public _agreements; 
    mapping(string => Agreement) public _agreements; // e.g. userId=>
    mapping(address => bool) private _allowedTokens;
    address[] private _allowedTokenKeys;


    event PlanUpdated(
        uint id,
        uint amount,
        uint decimals,
        uint frequency,
        uint personalBoxes,
        uint heirBoxes,
        uint heirs,
        string label,
        string description,
        uint personalBoxSlots,
        uint heirStrongBoxSlots
    );

    event AgreementCreated(
        address subscriber,
        address currency,
        uint createdAt,
        uint nextPayment
    );

    event PaymentSent(
        uint planId,
        address subscriber,
        address merchant,
        address currency,
        uint amount,
        uint paidAt
    );

    struct PlanParam {
        uint amount;
        uint decimals;
        uint frequency;
        uint personalBoxes;
        uint heirBoxes;
        uint heirs;
        string label;
        string description;
        uint personalBoxSlots;
        uint heirStrongBoxSlots;
    }


    //? Nominee payment Relation Declare

    struct NomineePaymentCurrency{
        address currency;
        uint256 amount;
        uint256 amount_usd;
        uint8 decimals_usd;
        address merchant;
    }

    mapping (address => NomineePaymentCurrency) nomineePaymentCurrencies;

    struct NomineePayment {
        address payer;
        address currency;
        uint256 amount;
        uint256 amount_usd;
        uint8 decimals_usd;
        uint paid_at;
    }


    mapping(string=> NomineePayment[]) nomineePayments; //? masterKey ( accountId ) => 

    mapping(string => mapping(string => NomineePayment) ) heirPayments; //? sbId => masterKey => 

    event NomineeStrongBoxPaid(
        uint8 payId,
        NomineePayment paymentData
    );

    event NomineeStrongBoxPaidByHeir(
        string sbId,
        string masterKey,
        NomineePayment paymentData
    );

    //? End of Nominee payment Relation Declare

    //! Declaration of One-time payment for Subscription // not used  
    // address public oneTimeVault;
    // uint256 public oneTimePrice; //? decimals 18 at USD 
    // mapping(address=>bool) public paidOnce;
    // event PaidOnce(uint256 indexed amount, address indexed currency, address indexed payer);
    //! End of Declaration One-Time payment for Subscription  //!! not used

    //? SERSH Token : Annual must be paid in SERSH
    address public SERSHToken;


    //? Declares of  planActivateFee

    mapping(uint=>uint256) public planActivateFee; //? planId=>Amount, decimals 18, USD price
    mapping(string=>uint[]) public activatedPlans;  //? userid => planIds[] , payerAddress will be stored on events;
    event PlanActivated (string indexed userId, address indexed payer, uint indexed planId, address currency, uint256 amount);

    //? End of planActivate Fee relation

    function initialize(
        address merchant,
        address[] memory tokens,
        PlanParam[] memory params
    ) public initializer {
        __Context_init_unchained();
        __Ownable_init();

        for (uint i = 0; i < tokens.length; i++) {
            _allowedTokens[tokens[i]] = true;
            _allowedTokenKeys.push(tokens[i]);
        }
        for (uint i = 0; i < params.length; i++) {
            _planIds.increment();
            uint planId = _planIds.current();

            // store plan in mapping
            _plans[planId] = Plan(
                planId,
                merchant,
                params[i].amount,
                params[i].decimals,
                params[i].frequency,
                params[i].personalBoxes,
                params[i].heirBoxes,
                params[i].heirs,
                params[i].label,
                params[i].description,
                params[i].personalBoxSlots,
                params[i].heirStrongBoxSlots
            );
        }
    }

    function addToken(address newToken) public onlyOwner {
        _allowedTokens[newToken] = true;
        _allowedTokenKeys.push(newToken);
    }

    function removeToken(address token) public onlyOwner {
        delete _allowedTokens[token];

        for (uint i = 0; i < _allowedTokenKeys.length; i++) {
            if (_allowedTokenKeys[i] == token) {
                _allowedTokenKeys[i] = _allowedTokenKeys[_allowedTokenKeys.length - 1];
                break;
            }
        }
        _allowedTokenKeys.pop();
    }

    function updatePlan(
        uint planId,
        address merchant,
        PlanParam memory param
    ) public payable onlyOwner nonReentrant {
        // checks
        require(planId > 0, "SereshPlan: Plan ID needs to be greater than 0");
        require(
            planId <= _planIds.current(),
            "SereshPlan: Plan ID is greater than plan count"
        );
        require(param.amount > 0, "SereshPlan: amount must be greater than 0");
        require(param.frequency > 0, "SereshPlan: frequency must be greater than 0");

        Plan storage plan = _plans[planId];
        plan.merchant = merchant;
        plan.amount = param.amount;
        plan.decimals = param.decimals;
        plan.frequency = param.frequency;
        plan.personalBoxes = param.personalBoxes;
        plan.heirBoxes = param.heirBoxes;
        plan.heirs = param.heirs;
        plan.label = param.label;
        plan.description = param.description;
        plan.personalBoxSlots = param.personalBoxSlots;
        plan.heirStrongBoxSlots = param.heirStrongBoxSlots;

        emit PlanUpdated(
            planId,
            param.amount,
            param.decimals,
            param.frequency,
            param.personalBoxes,
            param.heirBoxes,
            param.heirs,
            param.label,
            param.description,
            param.personalBoxSlots,
            param.heirStrongBoxSlots
        );
    }

    function setSERSH(address _sersh) external onlyOwner nonReentrant{
        require(SERSHToken != _sersh, 'Already set');
        require(Address.isContract(_sersh), 'Invalid token address');
        require(_sersh != address(0) , 'Address must not be zero.');

        SERSHToken = _sersh;
    }


    function createAgreement(
        uint planId,
        address currency, //? any address when user already activated plan, but otherwise must be one of the allowed stable tokens.
        string memory userId
    ) public payable nonReentrant {
        require(SERSHToken != address(0), 'Not ready yet');

        require(planId > 0 && planId <= _planIds.current(), "Invalid plan");

        //? checking if downgrade? limited for now
        require (_agreements[userId].plan.id <= planId, 'Limit to downgrade');


        bool _isActivatedPlan = false;
        for( uint i =0 ; i < activatedPlans[userId].length; i++) {
            if (activatedPlans[userId][i] == planId) {
                _isActivatedPlan = true;
                break;
            }
        } 

        Plan storage plan = _plans[planId];

        require(plan.merchant != address(0), 'Invalid plan merchant');

         //? Process annualFee payment in SERSH

        IERC20Metadata sershToken = IERC20Metadata(SERSHToken);

        require(
                sershToken.balanceOf(msg.sender) * 10 ** (18 - sershToken.decimals()) >= plan.amount * 10 ** (18 - plan.decimals),
                "Insufficient SERSH balance"
        );
        require(
                sershToken.allowance(msg.sender, address(this)) * 10 ** (18 - sershToken.decimals()) >= plan.amount  * 10 ** (18 - plan.decimals),
                "Not approved to pay SERSH"
        );


        //? Process activate Plan only when user didn't activated yet.
        if(_isActivatedPlan == false) {
            require(
                _allowedTokens[currency] == true, //? checking stable coin - activateFee Currency
                "SereshPlan: Token is not allowed."
            );
            require(planActivateFee[planId] > 0, 'Invalid activation fee');

            IERC20Metadata token = IERC20Metadata(currency);
            uint256 activateFeeAmount = planActivateFee[planId] / 10 ** (18 - token.decimals());

            //? check balance , allowance for plan activation with stable coin USDT/USDC
            require(token.balanceOf(msg.sender) >= activateFeeAmount, 'Insufficient activate fee balance.');
            require(token.allowance(msg.sender, address(this)) >= activateFeeAmount, 'Not approved for activate fee.' );

            //? Transfer activate fee
            token.transferFrom(msg.sender, plan.merchant, activateFeeAmount);
            activatedPlans[userId].push(planId);
            emit PlanActivated(userId, msg.sender, planId, currency, activateFeeAmount);
        }

        sershToken.transferFrom(msg.sender, plan.merchant, plan.amount / 10 ** (18 - sershToken.decimals()));

        emit PaymentSent(
            planId,
            msg.sender,
            plan.merchant,
            currency,
            plan.amount,
            block.timestamp
        );

        // create  new agreement
        _agreements[userId] = Agreement(
            plan,
            currency,
            msg.sender,
            block.timestamp,
            block.timestamp + plan.frequency
        );
        emit AgreementCreated(
            msg.sender,
            currency,
            block.timestamp,
            block.timestamp + plan.frequency
        );

    }



    function checkIfAgreementValid(
        // address subscriber
        string memory userId
    ) public view returns (bool) {

        Agreement storage agreement = _agreements[userId];
        require(agreement.subscriber != address(0), "agreement does not exist");
        return
            block.timestamp >= agreement.createdAt &&
            block.timestamp < agreement.expiredAt;
    }

    function getPlans() public view returns (Plan[] memory) {
        uint planCount = _planIds.current();

        Plan[] memory plans = new Plan[](planCount);

        for (uint i = 0; i < planCount; i++) {
            Plan storage plan = _plans[i + 1];
            plans[i] = plan;
        }

        return plans;
    }

    function getAllowedTokens() public view returns (address[] memory) {
        return _allowedTokenKeys;
    }

    //* NomineePayment Related Functions - updated
    function updateNomineePaymentCurrencies(address currency, NomineePaymentCurrency memory _npc) public onlyOwner {
        require(currency != address(0), 'Invalid currency.');
        require(currency == _npc.currency, 'Invalid input.');
        require(_npc.amount > 0, 'Invalid payment amount.');
        require(_npc.amount_usd > 0, 'Invalid payment amount.');

        nomineePaymentCurrencies[currency] = _npc;
    }

    function removeNomineePaymentCurrency(address currency) external onlyOwner nonReentrant{

        delete nomineePaymentCurrencies[currency];

    }

    function getNomineePaymentCurrency (address currency) public view returns (NomineePaymentCurrency memory) {
        return nomineePaymentCurrencies[currency];
    }

    function getNomineePayment (string memory userId) public view returns (NomineePayment[] memory np) {
        return nomineePayments[userId];
    }

    function getNomineePaymentById (string memory userId, uint8 _payId) public view returns (NomineePayment memory) {
        return nomineePayments[userId][_payId];
    }

    function getHeirPayment(string memory sbId, string memory userId) public view returns (NomineePayment memory) {

        return heirPayments[sbId][userId];
    }


    function createNomineeSBPrePayment (address currency, string memory userId ) public payable nonReentrant {
        // Agreement memory _agreement = _agreements[msg.sender];
        Agreement memory _agreement = _agreements[userId];
        // NomineePayment[] storage _np = nomineePayments[masterKey];

        // bool canCreateMore = _agreement.plan.heirBoxes > _np.length && _agreement.expiredAt >= block.timestamp;
        bool canCreateMore = _agreement.expiredAt >= block.timestamp;
        require(canCreateMore, 'Subscription is expired.');

        NomineePaymentCurrency storage npCurrency = nomineePaymentCurrencies[currency];
        require(npCurrency.currency != address(0), 'Invalid payment info.');

        IERC20Metadata token = IERC20Metadata(currency);

        require(token.balanceOf(msg.sender) >= npCurrency.amount, 'Insufficient balance');

        token.transferFrom(msg.sender, npCurrency.merchant, npCurrency.amount);

        NomineePayment memory newNp = NomineePayment (
            msg.sender,
            currency,
            npCurrency.amount,
            npCurrency.amount_usd,
            npCurrency.decimals_usd,
            block.timestamp
        );

        nomineePayments[userId].push(newNp);

        emit NomineeStrongBoxPaid(uint8(nomineePayments[userId].length - 1), newNp);
    }

    function createHeirSBPayment(address currency, string memory userId, string memory sbId ) public payable nonReentrant {

        // Agreement memory _agreement = _agreements[msg.sender];
        Agreement memory _agreement = _agreements[userId];

        NomineePayment memory _np = heirPayments[sbId][userId];
        require(_np.payer == address(0) && _np.amount == 0, 'Already paid.');
        require(_agreement.expiredAt >= block.timestamp, 'Subscription is expired.');

        NomineePaymentCurrency storage npCurrency = nomineePaymentCurrencies[currency];
        require(npCurrency.currency != address(0), 'Invalid payment info.');

        IERC20Metadata token = IERC20Metadata(currency);
        require(token.balanceOf(msg.sender) >= npCurrency.amount, 'Insufficient balance');

        uint256 allowance = token.allowance(msg.sender, address(this));
        require(allowance >= npCurrency.amount, 'Now allowed to transfer token.');

        token.transferFrom(msg.sender, npCurrency.merchant, npCurrency.amount);

        NomineePayment memory newNp = NomineePayment (
            msg.sender,
            currency,
            npCurrency.amount,
            npCurrency.amount_usd,
            npCurrency.decimals_usd,
            block.timestamp
        );

        heirPayments[sbId][userId] = newNp;
        emit NomineeStrongBoxPaidByHeir(sbId, userId, newNp);
    }

    //* End of NomineePayment Related Functions - updated

    function setPlanActivateFee (uint planId, uint256 usdAmount) external onlyOwner nonReentrant {

        require(usdAmount > 0, 'Invalid usd amount');
        require(planId > 0 && planId <= _planIds.current(), 'Invalid planId');
        require(planActivateFee[planId] != usdAmount, 'Already set');

        planActivateFee[planId] = usdAmount;
    }

    function isActivatedPlan(uint planId, string calldata userId) external view returns(bool) {
        bool _isActivatedPlan = false;
        for( uint i =0 ; i < activatedPlans[userId].length; i++) {
            if (activatedPlans[userId][i] == planId) {
                _isActivatedPlan = true;
                break;
            }
        } 
        return _isActivatedPlan;
    }

    function getActivatedPlans (string calldata userId) external view returns (uint[] memory) {
        return activatedPlans[userId];
    }

}
